CREATE SCHEMA sales;

CREATE TABLE sales.customers (
	customer_id SERIAL PRIMARY KEY,
	first_name VARCHAR (255) NOT NULL,
	last_name VARCHAR (255) NOT NULL,
	phone VARCHAR (25),
	email VARCHAR (255) NOT NULL,
	street VARCHAR (255),
	city VARCHAR (50),
	state VARCHAR (25),
	zip_code VARCHAR (5)
);

DROP TABLE sales.customers;


EXPLAIN SELECT * FROM sales.customers
WHERE first_name LIKE 'T%';

CREATE INDEX "first-name" ON sales.customers (first_name);

DROP INDEX "first-name";
